export default function Page(){
    let arr = []
    for(let i = 1; i < 10; i++){
        arr.push(i)
    }
    return(
        <div className="page-container">
            {arr.map(el=><button className="page_num-btn">{el}</button>)}
            <button className="page_num-btn">+</button>
        </div>
    )
}
